# https://sparql.uniprot.org/sparql
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX obo: <http://purl.obolibrary.org/obo/>

SELECT DISTINCT ?protein ?proteinName
WHERE {
  SERVICE <https://sparql.rhea-db.org/sparql> {
    ?reaction up:participant ?compound .
    ?compound skos:exactMatch obo:CHEBI_32395 .
    ?reaction up:enzyme ?enzyme .
    ?enzyme rdfs:subClassOf* up:Protein .
  }
  SERVICE <https://sparql.uniprot.org/sparql> {
    ?protein a up:Protein .
    ?protein up:mnemonic ?proteinName .
    ?protein up:accession ?accession .
    FILTER EXISTS { 
      ?protein up:catalyzedEvent ?reaction 
    } .
  }
}

# https://sparql.rhea-db.org/sparql
PREFIX rhea: <http://rdf.rhea-db.org/>
PREFIX ec: <http://purl.uniprot.org/enzyme/>
PREFIX uniprot: <http://purl.uniprot.org/uniprot/>
SELECT (COUNT(*) AS ?count)
WHERE {
  SERVICE <https://sparql.rhea-db.org/sparql> {
    ?reaction rhea:status ?status ;
              rhea:ec ?ec .
    ?ec ec:accession ?ecAccession .
    ?reaction rhea:side ?side .
    ?side ?p ?participant .
    ?participant rhea:participant ?protein .
    ?protein a/rdfs:subClassOf* uniprot:Protein .
  }
}
